import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <div className="footer-left">
          <p>&copy; 2023 Your Company Name. All rights reserved.</p>
        </div>
        <div className="footer-middle">
          <ul className="footer-links">
            <li><a href="#">Terms of Service</a></li>
            <li><a href="#">Privacy Policy</a></li>
          </ul>
        </div>
        <div className="footer-right">
          <ul className="social-links">
            <li><a href="https://www.instagram.com/yourcompany" target="_blank" rel="noopener noreferrer"><i className="fab fa-instagram"></i></a></li>
            <li><a href="https://www.youtube.com/yourcompany" target="_blank" rel="noopener noreferrer"><i className="fab fa-youtube"></i></a></li>
          </ul>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
